import { Wrapper, TextWrapper, ImageWrapper } from "../productDisplay/productDisplay.styled";


const ProductDisplay = (props) =>{
    const {product} = props;
    return(
        <Wrapper>
            <ImageWrapper>
                <img style={{width:"360px"}} src={product.image}/>
            </ImageWrapper>
            <TextWrapper>
                <TitleWrapper>
                    <p>
                        {product.title}
                    </p>
                </TitleWrapper>
                <DescriptionWrapper>
                <p>
                    {product.text}
                </p>
                </DescriptionWrapper>

            </TextWrapper>
        </Wrapper>

    )
}

export default ProductDisplay
